export class ComplicationOsteoporose
{
    PatientId:number;
    Osteoporose:boolean;
    AgeApparition:number;
    Traitement:boolean;
    SpecifierTraitement:string;
    Evolution:string;
    constructor()
    {
        this.PatientId=0;
        this.Osteoporose=false;
        this.AgeApparition=0;
        this.Traitement=false;
        this.SpecifierTraitement='';
        this.Evolution='';

    }
}
